import React, { Component, useState, useEffect } from 'react';
import Axios from 'axios';

const userList = [
    {
        'id': 0,
        'name': 'Jack Wixom',
        'password': 'qHYgwUc@gmail.com'
    }, {
        'id': 1,
        'name': 'Janet Wise',
        'password': 'sROkowT@gmail.com'
    }
];

const favoriteList = [
    {
        'user_id': 1,
        'room_id': 1
    }, {
        'user_id': 1,
        'room_id': 2
    }
];

class Signup extends Component {
    constructor(props) {
        super(props);
        this.state = {
            favoriteList: favoriteList
        }
    }

    componentDidMount() {
        fetch('/pillow/favorite/')
        .then(response => response.json())
        .then(result => this.setState({favoriteList: result}))
        .catch(e => e)
    }

    render() {
        return <div>
            <h1>Sign Up</h1>
            <div>Favorite List</div>
            <span>user_id room_id</span>
            {
                this.state.favoriteList.map(item => <div>
                    <span>{item.user_id} {item.room_id}</span>
                </div>)
            }
        </div>
    }
}

export default Signup;
